import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Link></Link>
      <Switch>
        <Route exact='/'>
          <MainPage></MainPage>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
